import Vue from 'vue';
import Router from 'vue-router';
Vue.use(Router);

const router = new Router({
  routes: [
    {
      path: '/',
      redirect: '/indexPage',
    },
    {
      path: "/indexPage",//首页
      name: "indexPage",
      component: () => import("@/views/indexPage"),
      meta: {
        title: "首页"
      },
    },
  ]
});

export default router;
